Perfeito Doc! É exatamente isso.  Os territórios subdividem-se em👇
- nervo mediano=>  pele da face palmar do 2º  e 3º dedos e ponta do polegar;
- nervo ulnar=> a pele da face palmar do 5º dedo e de metade do 4º dedo;
